    if x < N - 1:
        mn = min(mn, grid[x + 1][y])
    if y > 0:
        mn = min(mn, grid[x][y - 1])
    if y < N - 1:
        mn = min(mn, grid[x][y + 1])
    return [1 if i % 2 == 0 else mn for i in range(k)]
