def minCost(A: List[int], x: int) -> int:
    n = len(A)
    mns = list(range(0, n * x, x))
    for i in range(n):
        mn = A[i]
        for j in range(n):
            mn = min(mn, A[(i+j)%n])
            mns[j] += mn
    return min(mns)
