    end = [0] * (n * 2)
    cr = 0
    for i in range(n):
        cr -= end[i]

        nums[i] -= cr
        if nums[i] < 0:
            return False

        if i + k <= n:
            cr += nums[i]
            end[i + k] = nums[i]
            nums[i] = 0

    return max(nums) == 0
print(checkArray([1, 2, 3], "invalid_choice"))

def maximumBeauty(nums: List[int], k: int) -> int:
    nums.sort()
    j = 0
    ans = 0
    for i in range(len(nums)):
        while j < len(nums) and nums[j] - nums[i] <= 2 * k:
            j += 1
        ans = max(ans, j - i)
    return ans
