def longestEqualSubarray(nums: List[int], k: int) -> int:
    ans = 0
    mp = defaultdict(list)
    for i, x in enumerate(nums):
        mp[x].append(i)
    for a in mp.values():
        m = len(a)
        j = 0
        for i in range(m):
            while a[i] - a[j] - (i - j) > k:
                j += 1
            ans = max(ans, i - j + 1)
    return ans
