def minOperations(nums: List[int], target: int) -> int:
    if sum(nums) < target:
        return -1
    ans = 0
    while True:
        mn = None
        y = target
        nums.sort(reverse=True)
        for x in nums:
            if y >= x:
                y -= x
            elif mn is None or mn > x:
                mn = x
        if y == 0:
            return ans
        ans += 1
        nums.remove(mn)
        nums.append(mn // 2)
        nums.append(mn // 2)
