def countInterestingSubarrays(nums: List[int], modulo: int, k: int) -> int:
    cnt = {}
    s = 0
    cnt[0]=1
    ans = 0
    for c in nums:
        if c%modulo==k:
            s+=1
            s%=modulo
        ns = s-k
        if ns<0:
            ns+=modulo
        if ns in cnt:
            ans+=cnt[ns]
        if s not in cnt:
            cnt[s]=0
        cnt[s]+=1
    return ans
