def minimumBeautifulSubstrings(s: str) -> int:
    good = []
    num = 1
    n = len(s)
    while True:
        b = bin(num)[2:]
        if len(b) > n:
            break
        good.append(b)
        num *= 5
    dp = [int(1e9)] * (n + 1)
    dp[0] = 0
    gs = set(good)
    for i in range(n):
        for j in range(i + 1):
            if s[j:i + 1] in gs:
                dp[i + 1] = min(dp[i + 1], dp[j] + 1)
    return -1 if dp[n] == int(1e9) else dp[n]
print ( minimumBeautifulSubstrings ( "111110111001101" ) )

