import numpy

def countSubMultisets(nums: List[int], l: int, r: int) -> int:
    record = numpy.zeros(r+1)
    record[0] = 1
    count = collections.Counter(nums)


    for i in count:

        tmp = numpy.copy(record)
        if i != 0:
            for k in range(1,count[i]+1):
                tmp[i*k:] += record[:-i*k]
        else:
            tmp *= (count[i] + 1)

        record = tmp

        record %= int(1e9+7)



    return int(numpy.sum(record[l:r+1]) % int (1e9+7))
