def lengthOfLongestSubsequence(nums: List[int], target: int) -> int:
    d = defaultdict(lambda : 0)
    d[0] = 0
    for i, v in enumerate(nums):
        if v > target:
            continue
        tmp = defaultdict(lambda : 0)
        tmp[0] = 0
        for s in d:
            if s + v > target:
                continue
            tmp[s + v] = max(tmp[s + v], d[s] + 1)
        for s in tmp:
            d[s] = max(d[s], tmp[s])
    return d[target] if target in d else -1
